import "./App.css";
import axios from "axios";
import { useState, useEffect } from "react";

function App() {
  const [message, setMessage] = useState("");

  useEffect(() => {
    console.log("use");
    const getData = async () => {
      try {
        const res = await await fetch("http://127.0.0.1:3000/api", {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            message: "nameInput.value",
          }),
        });
        console.log(res);
        setMessage(res.data);
      } catch (e) {
        console.log(e);
      }
    };
    getData();
  }, []);

  return <div className="App"></div>;
}

export default App;
